pragma solidity ^0.8.10;
import "./Token.sol";

contract Bank {
    struct RegularDeposit {
        uint clientsBalanceBNB;
        uint depositTimeStamp;
        uint interest;
        bool isDeposited;
    }

    struct DoubleInterestDeposit {
        uint clientsBalanceBNB;
        uint depositTimeStamp;
        uint interest;
        bool isDeposited;
    }

    //assign Token contract to variable
    Token private token;
    // hash address - uint
    mapping(address => RegularDeposit) public regularDeposit;
    mapping(address => DoubleInterestDeposit) public doubleInterestDeposit;
    uint bnbFromSales = 0;
    uint totalBMIW = 0;

    //pass as constructor argument deployed Token contract
    constructor(Token _token) public {
        //assign token deployed contract to variable
        token = _token;
    }

    function deposit() public payable {
        regularDeposit[msg.sender].interest = getClientBalanceBMIW(); 
        regularDeposit[msg.sender].clientsBalanceBNB =
            regularDeposit[msg.sender].clientsBalanceBNB +
            msg.value;
        regularDeposit[msg.sender].depositTimeStamp = block.timestamp;
        regularDeposit[msg.sender].isDeposited = true;
    }

    function depositDoubleInteresr() public payable {
        doubleInterestDeposit[msg.sender].interest = getClientBalanceBMIWDoubleInterest();
        doubleInterestDeposit[msg.sender].clientsBalanceBNB =
            doubleInterestDeposit[msg.sender].clientsBalanceBNB +
            msg.value;
        doubleInterestDeposit[msg.sender].depositTimeStamp = block.timestamp;
        doubleInterestDeposit[msg.sender].isDeposited = true;
    }

    function withdraw() public payable {
        require(
            regularDeposit[msg.sender].isDeposited == true,
            "Error, no previous deposit"
        );
        require(msg.value == 0.05 ether, "Must provide 0.05 BNB to withdraw");

        uint interest = getClientBalanceBMIW();

        // return the BNB to original wallet
        payable(msg.sender).transfer(
            regularDeposit[msg.sender].clientsBalanceBNB - 0.008 ether
        );
        regularDeposit[msg.sender].clientsBalanceBNB = 0.05 ether;

        // Crear el token y lo envia a la addres del msg.sender
        token.mint(msg.sender, interest);
        // reiniciar reposito
        regularDeposit[msg.sender].depositTimeStamp = 0;
        regularDeposit[msg.sender].isDeposited = false;
    }

    function withdrawDoubleInterest() public payable {
        require(
            doubleInterestDeposit[msg.sender].isDeposited == true,
            "Error, no previous deposit"
        );
        require(msg.value == 0.05 ether, "Must provide 0.05 BNB to withdraw");
        require(
            (block.timestamp -
                doubleInterestDeposit[msg.sender].depositTimeStamp) >= 600,
            "Must wait at least 10 minutes before withdraw"
        );

        uint interest = getClientBalanceBMIW();

        // return the BNB to original wallet
        payable(msg.sender).transfer(
            doubleInterestDeposit[msg.sender].clientsBalanceBNB - 0.008 ether
        );
        doubleInterestDeposit[msg.sender].clientsBalanceBNB = 0.05 ether;

        // Crear el token y lo envia a la addres del msg.sender
        token.mint(msg.sender, interest);
        // reiniciar reposito
        doubleInterestDeposit[msg.sender].depositTimeStamp = 0;
        doubleInterestDeposit[msg.sender].isDeposited = false;
    }

    function getClientBalanceBNB() public view returns (uint) {
        return regularDeposit[msg.sender].clientsBalanceBNB;
    }

    function getClientBalanceBNBDoubleInterest() public view returns (uint) {
        return doubleInterestDeposit[msg.sender].clientsBalanceBNB;
    }

    function getClientBalanceBMIW() public view returns (uint) {
        return regularDeposit[msg.sender].interest + calculateBMIW();
    }

    function getClientBalanceBMIWDoubleInterest() public view returns (uint) {
        return doubleInterestDeposit[msg.sender].interest + calculateBMIWDoubleInterest();
    }

    function calculateBMIW() public view returns (uint) {
        if (regularDeposit[msg.sender].isDeposited) {
            uint depositTotalTime = block.timestamp -
                regularDeposit[msg.sender].depositTimeStamp;
            uint interestPerSecond = (100 *
                regularDeposit[msg.sender].clientsBalanceBNB) / 31668017;
            uint interest = interestPerSecond * depositTotalTime;

            return interest;
        }
        return 0;
    }

    function calculateBMIWDoubleInterest() public view returns (uint) {
        if (doubleInterestDeposit[msg.sender].isDeposited) {
            uint depositTotalTime = block.timestamp -
                doubleInterestDeposit[msg.sender].depositTimeStamp;
            uint interestPerSecond = (200 *
                doubleInterestDeposit[msg.sender].clientsBalanceBNB) / 31668017;
            uint interest = interestPerSecond * depositTotalTime;

            return interest;
        }
        return 0;
    }

    function buyBMIW(uint amountOfBMIW) payable public returns (bool) {

        require(msg.value >= amountOfBMIW*0.001 ether, "Insuficient amount of BNB");

        bool sucess = true;

        bnbFromSales = bnbFromSales + (amountOfBMIW*0.001 ether);
        token.mint(msg.sender, amountOfBMIW * 1 ether);
        totalBMIW = totalBMIW + (amountOfBMIW * 1 ether);

        return sucess;
    }

    function getBalance() public view returns (uint256) {
        return payable(address(this)).balance;
    }

    function getBNBFromSales() public view returns (uint256) {
        return bnbFromSales;
    }

    function getBMIWPrice() public view returns (uint256) {
        if (totalBMIW == 0) {
            return 0;
        }
        return (bnbFromSales * 1e18)/totalBMIW;
    }

    function getTotalBMIW() public view returns (uint256) {
        return totalBMIW;
    }

    function sellBMIW(uint amountOfBMIW) public returns (bool) {
        require(token.balanceOf(msg.sender) >= amountOfBMIW * 1 ether, "Insufficient amount of BMIW");
        require(bnbFromSales >= getBMIWPrice()*amountOfBMIW, "The bank doesn't have enough BNB");

        bool sucess = true;

        token.transferFrom( msg.sender, address(this), amountOfBMIW * 1 ether); 
        
        payable(msg.sender).transfer(
            (getBMIWPrice()*amountOfBMIW)
        );

        bnbFromSales = bnbFromSales - getBMIWPrice()*amountOfBMIW;

        return sucess;
    }
}
